import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
//import './App.css';

function myLink(props){
  return( 
    <div className="App-link">
      Hello {props.name}
    </div>)
}

function App() {
  return (
    <Router>
      <myLink name="Why" />
      <div className="App-header">
        <nav>
          <ul className="App-link">
            <li>
              <About name="FLOW"/>
            </li>
            <li>
              <Link to="/fishyfish">About</Link>
            </li>
            <li>
              <Link to="/users">Users</Link>
            </li>
          </ul>
        </nav>

        {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
        <Switch>
          <Route path="/(.*fish)/" >
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

function Home() {
  return <h2>Home</h2>;
}

function About(props) {
  return <h2>About {props.name}</h2>;
}

function Users() {
  return <h2>Users</h2>;
}


export default App;
